package com.petrabytes.views.wellbore;

public class Blgz_Completion_Info {
	
	private String id;
	private String depth;
	private String endDepth;
	private String completion;
	private String partID;
	private String depthUnit;
	
	
	
	public Blgz_Completion_Info() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getId() {
		return id;
	}
	public void setId(String id) {
		this.id = id;
	}
	public String getDepth() {
		return depth;
	}
	public void setDepth(String depth) {
		this.depth = depth;
	}
	public String getEndDepth() {
		return endDepth;
	}
	public void setEndDepth(String endDepth) {
		this.endDepth = endDepth;
	}
	public String getCompletion() {
		return completion;
	}
	public void setCompletion(String completion) {
		this.completion = completion;
	}
	public String getPartID() {
		return partID;
	}
	public void setPartID(String partID) {
		this.partID = partID;
	}
	public String getDepthUnit() {
		return depthUnit;
	}
	public void setDepthUnit(String depthUnit) {
		this.depthUnit = depthUnit;
	}
	
	

}
